/* eslint-disable no-unused-vars */
import React from 'react';
import './App.css'
import ThumbUpAltIcon from '@material-ui/icons/ThumbUpAlt';
import ThumbDownIcon from '@material-ui/icons/ThumbDown';
import GradeIcon from '@material-ui/icons/Grade';

function Card() {
    return (
        <>
        <div className="container">
            <div className="image_container">
            
            <img style={{position:"absolute",width:"100%",height:"100%",borderRadius:"8%",border:"4px solid white"}} src="https://images.unsplash.com/photo-1503864664483-e8a499e2eb22?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=512&q=80" alt="undefined"/>
            <div className="percentage">
                <div className="text_box">50%<ThumbUpAltIcon/></div>
            </div>
            <div className="option">
                <ThumbUpAltIcon className="option_like" style={{fontSize:"55"}}/>
                <ThumbDownIcon className="option_dislike" style={{fontSize:"55"}}/>
                
            </div>
            </div>
            <div className="story_container">
                <strong className="story_title">Movie Name</strong>
                <div className="story">
                    <div className="rating"><p style={{paddingTop:"0"}}>Rating: </p><GradeIcon/><GradeIcon/><GradeIcon/><GradeIcon/><GradeIcon/></div>
                    <div className="overview"></div>
                </div>
            </div>
        </div>
        </>
    )
}
export default Card;
